import React from 'react';

function App() {
  return (
    <div className="App">
      <header><img src='https://ru.wikipedia.org/wiki/Logo_(%D1%82%D0%B5%D0%BB%D0%B5%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB)#/media/%D0%A4%D0%B0%D0%B9%D0%BB:Logo_TV_2015.svg' /></header>
    </div>
  );
}

export default App;
